import React, { Component } from 'react';

class Detail extends Component {
  render() {
    const {id, title} = this.props.match.params;
    console.log(id);
    return (
      <ul>
        <li>Id: {id}</li>
        <li>Title: {title}</li>
        <li>Content:</li>
      </ul>
    );
  }
}

export default Detail;
